const csvUrl="https://docs.google.com/spreadsheets/d/e/2PACX-1vQ7TcPhsH4A5h-NN7KRWgfXr5cfYiHMZGj8Jxizzs3GFh74-gBo8u3d4Q09LUYgGUBVUr33yfVuUiX7/pub?gid=0&single=true&output=csv";function reformatDate(dateString){const months=["Jan","Feb","Mar","Apr","May","Jun","Jul","Aug","Sep","Oct","Nov","Dec"],date=new Date(dateString),day=String(date.getDate()).padStart(2,"0"),month=months[date.getMonth()],year=String(date.getFullYear()).slice(2);return`${day} ${month} ${year}`}async function fetchCsvData(){const response=await fetch(csvUrl),reader=response.body.getReader(),result=await reader.read(),decoder=new TextDecoder("utf-8"),csv=decoder.decode(result.value);return csv}const now=new Date;async function displayData(){const csvData=await fetchCsvData(),data=Papa.parse(csvData,{header:!0}).data;console.log(data);const futureDates=data.filter(item=>new Date(item.startDate)>=now),tourDatesElement=document.getElementById("tourDates");futureDates.length>0&&(tourDatesElement.innerHTML="<h1>UPCOMING EVENTS</h1>",futureDates.forEach(item=>{const startDate=reformatDate(item.startDate);tourDatesElement.innerHTML+=`<a target="_blank" href="${item.eventURL}">${startDate}, ${item.eventVenue}, ${item.eventCity}</a>`}))}window.onload=displayData;